// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SimpleSupplyChain {
    // Contract owner's address
    address public owner;
    // Counter to generate unique product IDs
    uint256 public productCount;

    // Basic product structure with essential tracking information
    struct Product {
        uint256 id;          // Unique identifier for the product
        string name;         // Name of the product
        address currentOwner;// Current owner's address
        uint256 timestamp;   // Last update timestamp
        bool isRecalled;     // Product recall status
    }

    // Maps product ID to Product struct
    mapping(uint256 => Product) public products;
    // Maps addresses to their authorization status
    mapping(address => bool) public authorizedParticipants;

    // Events to log important actions
    event ProductCreated(uint256 productId, string name, address owner);
    event OwnershipTransferred(uint256 productId, address from, address to);
    event ProductRecalled(uint256 productId);

    // Ensures only the contract owner can call certain functions
    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    // Ensures only authorized participants can call certain functions
    modifier onlyAuthorized() {
        require(authorizedParticipants[msg.sender], "Not authorized");
        _;
    }

    // Constructor: Sets up the contract owner and authorizes them
    constructor() {
        owner = msg.sender;
        authorizedParticipants[msg.sender] = true;
    }

    // Allows owner to add new authorized participants
    function addParticipant(address participant) public onlyOwner {
        authorizedParticipants[participant] = true;
    }

    // Creates a new product in the supply chain
    function createProduct(string memory name) public onlyAuthorized {
        // Increment product counter
        productCount++;

        // Create new product with initial values
        products[productCount] = Product({
            id: productCount,
            name: name,
            currentOwner: msg.sender,
            timestamp: block.timestamp,
            isRecalled: false
        });

        // Emit event for product creation
        emit ProductCreated(productCount, name, msg.sender);
    }

    // Transfers product ownership to a new address
    function transferProduct(uint256 productId, address newOwner) public onlyAuthorized {
        // Check if sender is current owner
        require(products[productId].currentOwner == msg.sender, "Not the owner");
        // Check if product is not recalled
        require(!products[productId].isRecalled, "Product recalled");

        // Store previous owner for event
        address previousOwner = products[productId].currentOwner;

        // Update product ownership and timestamp
        products[productId].currentOwner = newOwner;
        products[productId].timestamp = block.timestamp;

        // Emit transfer event
        emit OwnershipTransferred(productId, previousOwner, newOwner);
    }

    // Marks a product as recalled
    function recallProduct(uint256 productId) public onlyAuthorized {
        // Check if product is not already recalled
        require(!products[productId].isRecalled, "Already recalled");

        // Mark product as recalled
        products[productId].isRecalled = true;

        // Emit recall event
        emit ProductRecalled(productId);
    }

    // View function to get product details
    function getProduct(uint256 productId) public view returns (
        uint256 id,
        string memory name,
        address currentOwner,
        uint256 timestamp,
        bool isRecalled
    ) {
        // Get product from storage
        Product memory product = products[productId];

        // Return all product fields
        return (
            product.id,
            product.name,
            product.currentOwner,
            product.timestamp,
            product.isRecalled
        );
    }
}

